        private static int[][] FindNearest( int[][] mat)
        {
            int[][] res = new int[mat.Length][];
            for (int i = 0; i < mat.Length; i++)
            {
                res[i] = new int[mat[0].Length];
                for (int j = 0; j < mat[0].Length; j++)
                {

                    res[i][j] = GetNearestZero( mat,i, j);

                }
            }
            return res;
        }

        private static int GetNearestZero( int[][] mat, int i, int j)
        {
            int step = 0;
           
            if (mat[i][j] == 0)
            { 
                return step;
            }
            HashSet<(int, int)> visited = [];

            Queue<(int, int,int)> queque = new Queue<(int, int,int)>();
            queque.Enqueue((i, j,step));
            visited.Add((i, j));

            while (queque.Count > 0)
            {   
                var point = queque.Dequeue();
                i = point.Item1; j = point.Item2;
                //Console.WriteLine($"{i}:{j}:{mat[i][j]}");
               // Console.WriteLine(step);
                var currentStep = point.Item3;
              
              
                               
                int left = j - 1;
                int right = j + 1;
                int up = i - 1;
                int down = i + 1;
                if ((left >= 0 && mat[i][left] == 0) || (right < mat[0].Length && mat[i][right] == 0) || (up >= 0 && mat[up][j] == 0) || (down < mat.Length && mat[down][j] == 0))
                {
                    currentStep++;
                  return currentStep;
                }
                
                else
                {
                    currentStep++;
                    if (left >= 0 && !visited.Contains((i, left)))
                    {
                        visited.Add((i, left));
                        queque.Enqueue((i, left, currentStep));
                    }
                    if (up >= 0 && !visited.Contains((up,j)))
                    {
                        visited.Add((up, j));
                        queque.Enqueue((up, j, currentStep));
                    }
                    if (down < mat.Length && !visited.Contains((down, j)))
                    {
                        visited.Add((down, j));
                        queque.Enqueue((down, j, currentStep));

                    }
                    if (right < mat[0].Length && !visited.Contains((i, right)))
                    {
                        visited.Add((i, right));
                        queque.Enqueue((i, right, currentStep));
                    }
                    
                }
                step = currentStep;
            }

            return step;

        }
    }
